    private static String getStringInputFromFile(String filename)
    {
        Scanner scan = new Scanner(AdventOfCodeMain.class.getResourceAsStream(filename));

        StringBuilder sb = new StringBuilder();
        while(scan.hasNext())
        {
            sb.append(scan.nextLine() + "\n");
        }

        return sb.toString();
    }

